import React from 'react';
import { StyleSheet, Text, View, ImageBackground, SectionList } from 'react-native';

// const App = () => {...}
export default function App() {
  return (
    <View style={styles.container}>
    <ImageBackground source={{uri: 'https://images.unsplash.com/photo-1481070555726-e2fe8357725c?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=870&q=80'}} style={styles.imageBackground}>
    </ImageBackground>
      <View style={{flex:2, alignItems:'center', position: 'absolute', top: 0, left: 0, right: 0, bottom: 0, alignItems: 'center'}}>
          <Text style={styles.header}>
              These are recipes that you saved!
          </Text>
      <View style={{flex:4}}>
      <SectionList
          sections={[
            {title: 'D', data: ['Devin', 'Dan', 'Dominic']},
            {title: 'J', data: ['Jackson', 'James', 'Jillian', 'Jimmy', 'Joel', 'John', 'Julie']},
          ]}
          renderItem={({item}) => <Text style={styles.item}>{item}</Text>}
          renderSectionHeader={({section}) => <Text style={styles.sectionHeader}>{section.title}</Text>}
          keyExtractor={(item, index) => index}
        />
      </View>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'stretch',
    justifyContent: 'stretch',
  },
  header: {
    flex:1,
    alignItems:'center',
    fontSize:24,
    padding:25,
    color:"while",
  },
  imageBackground: {
    width: '100%',
     height: '100%',
    opacity: 0.8
  },
  item:{
    fontSize:20
  }

});
